  langs:
  - csharp
  name: XmlnsDictionary
  nameWithType: XmlnsDictionary
  fullName: System.Windows.Markup.XmlnsDictionary
  type: Class
  summary: "WPF의 XAML 네임 스페이스에 대 한 xmlns 매핑이 포함 된 사전을 나타냅니다."
  remarks: "XmlnsDictionary 전체 XAML 네임 스페이스 URI에 XAML 네임 스페이스 접두사를 매핑합니다. 응용 프로그램에서 XAML 사용 하 고 일반적으로 XAML 네임 스페이스에 대 한 URI가 자주 포함 하는 스키마 스타일 URI `http://`합니다. CLR 네임 스페이스와 어셈블리에 대 한 사용자 정의 매핑을 호스팅하려는 합니다. 어셈블리에는 백업을 입력 합니다. 자세한 내용은 참조 [XAML 네임 스페이스 및 WPF XAML에 대 한 매핑 Namespace](~/add/includes/ajax-current-ext-md.md)합니다.       XmlnsDictionary 범위는 XAML 네임 스페이스에 대 한 개념을 추가합니다. 기본 <xref:System.Collections.IDictionary>접두사 키와 XML 네임 스페이스 URI 값이 포함 될 수 있습니다.</xref:System.Collections.IDictionary> XmlnsDictionary에서 범위 개념에는 접두사를 재정의할 수 있는지 XML 개념과 유사 합니다. 따라서 재정의 적용 되는 경우 해당 수준에서 또는 하위 수준의 (이전 정의 DOM의 더 높은 수준에서 적용) XML DOM 보기의 합니다. 범위 개념 대부분 추출 된 XmlnsDictionary api에서와 같은 Api를 호출할 수 있도록 <xref:System.Windows.Markup.XmlnsDictionary.LookupNamespace%2A>범위와 관계 없이.</xref:System.Windows.Markup.XmlnsDictionary.LookupNamespace%2A> XmlnsDictionary에서 노출 하는 반면 <xref:System.Windows.Markup.XmlnsDictionary.PushScope%2A>및 <xref:System.Windows.Markup.XmlnsDictionary.PopScope%2A>되도록 사용자 지정 <xref:System.Windows.Markup.ParserContext>범위를 변경 하는 구현 된 XmlnsDictionary의 범위와 동기화 할 수 있습니다.</xref:System.Windows.Markup.ParserContext> </xref:System.Windows.Markup.XmlnsDictionary.PopScope%2A> </xref:System.Windows.Markup.XmlnsDictionary.PushScope%2A>      <a name=&quot;xamlTextUsage_XmlnsDictionary&quot;></a># # XAML 텍스트 사용"
  syntax:
    content: 'public class XmlnsDictionary : System.Collections.IDictionary, System.Xaml.IXamlNamespaceResolver'
  inheritance:
  - System.Object
  implements:
  - System.Collections.IDictionary
  - System.Xaml.IXamlNamespaceResolver
